import React from 'react';
import Container from '@material-ui/core/Container';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';
import Link from '@material-ui/core/Link';
import ProTip from './ProTip';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import { makeStyles } from '@material-ui/core/styles';

import NavBar from "./components/navbar";
import ContractCreator from "./components/contract_creator";

const useStyles = makeStyles(theme => ({
	root: {
		flexGrow: 1,
	},

	control: {
		padding: theme.spacing(2),
	},

	paper: {
		padding: theme.spacing(3),
    	textAlign: 'center',
    	color: theme.palette.text.secondary,
	},
}));

export default function App() {
	const classes = useStyles();

	return (
		<React.Fragment>
			<NavBar/>
			<main>
				<Container maxWidth="lg">
					<Grid container className={classes.root} spacing={2} justify = "center">
						<Grid item xs={10} sm={10}>
							<Paper className={classes.paper}>bidder</Paper>
						</Grid>
						<Grid item xs={10} sm={10}>
							<Paper className={classes.paper}>
								seller
								<ContractCreator/>
							</Paper>
						</Grid>
						<Grid item xs={10} sm={10}>
							<Paper className={classes.paper}>auctioneer</Paper>
						</Grid>
					</Grid>
				</Container>

				<Container maxWidth="sm">
					<Box my={4}>
						<Typography className={classes.typography} color="textSecondary">
      						Material-UI documentation.
    					</Typography>
						<Typography variant="body2" color="textSecondary" align="center">
      						Made by Remo Andreoli (2018/2019)
    					</Typography>
					</Box>
				</Container>
			</main>
		</React.Fragment>
	);
}
